import { Component, ViewChild, ElementRef } from '@angular/core';

@Component({
  selector: 'app-root',
  template: '<canvas #canvas width="100" height="150"></canvas>',
  // styles: ['canvas { display:none }']
})
export class AppComponent {
  @ViewChild('canvas', { static: true })
  canvas: ElementRef<HTMLCanvasElement>;
  private ctx: CanvasRenderingContext2D;

  colorMarker = "red";
  borderMArker = 9;
  zoomImage = 0;

  ngOnInit(): void {
    this.ctx = this.canvas.nativeElement.getContext('2d');
    this.generateMarker();

    this.setImage(this.test64)


    setTimeout(() => {
      this.clearMarker()
    }, 3000)
  }

  generateMarker() {
    this.ctx.beginPath();
    this.ctx.moveTo(0, 50); // левый угол
    this.ctx.lineTo(50, 150); // нижний угол
    this.ctx.lineTo(100, 50); // правый угол
    this.ctx.closePath();

    this.ctx.fillStyle = this.colorMarker;
    this.ctx.fill();

    this.clearMarker()
  }

  clearMarker() {
    this.ctx.beginPath();
    this.ctx.arc(50, 50, 50, 0, 2 * Math.PI, false);
    this.ctx.fillStyle = this.colorMarker;
    this.ctx.fill();

    this.ctx.beginPath();
    this.ctx.arc(50, 50, 50 - this.borderMArker - 1, 0, 2 * Math.PI, false);
    this.ctx.fillStyle = "white";
    this.ctx.fill();
  }

  setImage(image64base) {
    this.clearMarker()

    var image = new Image();
    image.src = image64base
    image.onload = () => this.cutImage(image);
  }

  cutImage(image) {
    this.ctx.save();
    this.ctx.beginPath();
    this.ctx.arc(50, 50, 50 - this.borderMArker, 0, Math.PI * 2, true);
    this.ctx.closePath();
    this.ctx.clip();

    const pointStart = 5 - this.zoomImage;
    const pointFinish = 90 + this.zoomImage * 2
    this.ctx.drawImage(image, pointStart, pointStart, pointFinish, pointFinish);

    console.log(this.canvas.nativeElement.toDataURL("image/png"));
    // console.log(this.canvas.toDataURL("image/png"));
  }

  test64 = 'data:image/png;base64,'
}
